import React from 'react';


function Warm() {
    return (
        <div>
            <h1>You have a Warm skin tone. </h1>
            <img className='toneImg' alt="" src="https://media.proprofs.com/images/QM/user_images/1754155/1480070997.png" />
            <h3 className='resultDescr'>If you fall under this category, try sticking to earthier makeup and clothing, such as yellow, orange, brown, orangey-reds, and yellow-green shades. For foundation, you'll probably look best in formulations with a yellow or golden undertone. And be sure to reach for the deep brick-red lipstick when it comes to a night out on the town; it's sure to make your complexion pop.</h3>
        </div>
    );
};



export default Warm;
